import React, { Component } from 'react';
import { Layout } from 'antd';
import '.././css/uploadfilepage.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';
import { Image } from 'react-bootstrap';
import { ListGroup} from 'react-bootstrap';
import { Form, Row, Col} from 'react-bootstrap';
import { Button as SubmitButton } from 'react-bootstrap'

import { Upload, message, Button } from 'antd';
import { UploadOutlined } from '@ant-design/icons';

import { DatePicker, Space } from 'antd';

const props = {
  name: 'file',
  action: 'https://www.mocky.io/v2/5cc8019d300000980a055e76',
  headers: {
    authorization: 'authorization-text',
  },
  onChange(info) {
    if (info.file.status !== 'uploading') {
      console.log(info.file, info.fileList);
    }
    if (info.file.status === 'done') {
      message.success(`${info.file.name} file uploaded successfully`);
    } else if (info.file.status === 'error') {
      message.error(`${info.file.name} file upload failed.`);
    }
  },
};

const { Content, Sider } = Layout;

class uploadfilepage extends Component{
  constructor(props) {
    super(props);

    this.state = {
        selectedFile: null,
        longitude: 0,
        latitude: 0,
        altitude: 0,
        satellite: "",
        frequency: 0,
        rate: 0,
        time: "",
    }

    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }

  handleLogout() {
    localStorage.clear();
    window.location.href = "/";
  }

  onChange(value, dateString) {
    console.log('Selected Time: ', value);
    console.log('Formatted Selected Time: ', dateString);
  }

  onOk(value) {
    console.log('onOk: ', value);
  }

  onFileChange = event => {
    this.setState({ selectedFile: event.target.files[0] });
  };

  handleChange(e) {
    this.setState({ [e.target.name] : e.target.value });
  }

  render(){
    return (
      <div>
        <Layout>
          <Navbar fixed="top" expand="lg" bg="dark" variant="dark">
            <Navbar.Brand className="navbar-brand">Quasar</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
              <Nav className="mr-auto">
                   <Nav.Link href="/profile">profile</Nav.Link>
                   <Nav.Link href="/data">visualize data</Nav.Link>
               </Nav>
              <Nav>
                <Nav.Link onClick={this.handleLogout}>Log out</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
          <Layout>
            <Sider width={200} style={{ padding: '8% 1%', background: 'white' }}>
              <Image className="profile-img" src="https://images.hdrsoft.com/images/lighthouse/thumbs/hdr-vibrant.jpg" roundedCircle />
              <ListGroup variant="flush">
                <ListGroup.Item></ListGroup.Item>
                <ListGroup.Item>name: vivian</ListGroup.Item>
                <ListGroup.Item>location: San Jose</ListGroup.Item>
                <ListGroup.Item></ListGroup.Item>
              </ListGroup>
            </Sider>
            <Layout style={{ padding: '8% 0%' }}>
              <Content
                className="site-layout-background"
                style={{
                  padding: '3% 5%',
                  margin: 0,
                  minHeight: 580,
                }}
              >
                <Form
                  className="form-satellite"
                  onSubmit={this.handleSubmit}
                >
                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     File
                   </Form.Label>
                   <Col sm={10}>
                   <Upload {...props}>
                     <Button icon={<UploadOutlined />} onChange={this.onFileChange} >Click to Upload</Button>
                    </Upload>
                   </Col>
                 </Form.Group>

                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     Location
                   </Form.Label>

                    <Form.Group as={Col}>
                      <Form.Label>Longitude(degree)</Form.Label>
                      <Form.Control
                        type="text"
                        name="longitude"
                        value = {this.state.longitude}
                        onChange={this.handleChange}
                      />
                    </Form.Group>

                    <Form.Group as={Col}>
                      <Form.Label>Latitude(degree)</Form.Label>
                      <Form.Control
                        type="text"
                        name="latitude"
                        value = {this.state.latitude}
                        onChange={this.handleChange}
                      />
                    </Form.Group>

                    <Form.Group as={Col} >
                      <Form.Label>Altitude(km)</Form.Label>
                      <Form.Control
                        type="text"
                        name="altitude"
                        value = {this.state.altitude}
                        onChange={this.handleChange}
                      />
                    </Form.Group>
                  </Form.Group>


                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     Satellite
                   </Form.Label>
                   <Col sm={10}>
                     <Form.Control placeholder="Satellite"
                       type="text"
                       name="satellite"
                       value = {this.state.satellite}
                       onChange={this.handleChange}
                     />
                   </Col>
                 </Form.Group>

                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     Frequency(Hz)
                   </Form.Label>
                   <Col sm={10}>
                     <Form.Control placeholder="Frequency"
                       type="text"
                       name="frequency"
                       value = {this.state.frequency}
                       onChange={this.handleChange}
                     />
                   </Col>
                 </Form.Group>

                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     Rate(ksps)
                   </Form.Label>
                   <Col sm={10}>
                     <Form.Control placeholder="Rate"
                       type="text"
                       name="rate"
                       value = {this.state.rate}
                       onChange={this.handleChange}
                     />
                   </Col>
                 </Form.Group>

                 <Form.Group as={Row} className="left">
                   <Form.Label column sm={2}>
                     Time(UTC)
                   </Form.Label>
                   <Col sm={10}>
                     <Space direction="vertical" size={12}>
                        <DatePicker showTime onChange={this.onChange} onOk={this.onOk} />
                      </Space>
                   </Col>
                 </Form.Group>
                 <SubmitButton className="form-btn" variant="dark" type="submit" >
                   Upload
                 </SubmitButton>
               </Form>
              </Content>
            </Layout>
          </Layout>
        </Layout>
      </div>
    );
  }
}

export default uploadfilepage;
